export default class MasterState {
    constructor(productsPriceRange,productsNumber,productsPreferredBrand,productsPreferredColor,productsPreferedSizes) {
        this.productsPriceRange = productsPriceRange;
        this.productsNumber = productsNumber;
        this.productsPreferredBrand = productsPreferredBrand;
        this.productsPreferredColor = productsPreferredColor;
        this.productsPreferedSizes = productsPreferedSizes;
}};
